import {DataTable} from 'primereact/datatable';

class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: [] };
        
    }

    ejemploo() {
        /*var data;
        API.get('getRef.do?json={"id":"funRegistroGarantias"}').then(function (result){
