            //this.state.fiduca = result;
            return result;
            
        }).catch (function (error){
            console.log(`ðŸ˜± Axios request failed: ${error}`);
        });*/
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        /*var headers = {
            "Access-Control-Allow-Origin":"*",
            "Access-Control-Allow-Methods":"GET, POST, PATCH, PUT, DELETE, OPTIONS",
            "Access-Control-Allow-Headers":"Origin, Content-Type, X-Auth-Token"
            }*/
        // Load async data.
            /*getRef.do?json={"id":"funRegistroGarantias"}*/
            //const response = await API.get('https://jsonplaceholder.typicode.com/todos/1');
        /*const response = API.get('getRef.do?json={"id":"funRegistroGarantias"}').then(function (result){
            console.log('ðŸ‘‰ Returned data:', result);
        }).catch (function (error){
            console.log(`ðŸ˜± Axios request failed: ${error}`);
        });*/
        this.ejemploo().then(data => {
            //console.log('JSON: ' + JSON.stringify(data));
            this.setState({fiduca: data});
        });
        
    }
    
    render() {
        console.log('JSON: ' + JSON.stringify(this.state));
        //const { fiduca } = thi
        let cols = [
            {field: 'fgarIdFideicomiso', header: 'Fiso'},
            {field: 'fgarCveGarantia2', header: 'Garantia'},
        ];

        let dynamicColumns = cols.map((col,i) => {
            return <Column key={col.field} field={col.field} header={col.header} />;
        });

        return (
            <div>
                <DataTable value={this.state.fiduca}>
                    {dynamicColumns}
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
